import React from 'react';
import Footer from './Footer';
import Presentation from './Presentation';

const Admin = () => {
    return (
        <div>
            <Presentation/>
                <div style={{display:'flex'}}>
                    <div className="AjoutVoitureDiv">
                        <a className="ajouterVoiture"> Ajouter une nouvelle Voiture </a>
                    </div>
                    <div className="AjoutVoitureDiv">
                        <a className="ajouterVoiture"> Actualiser </a>
                    </div>
                </div>
            <Footer/>
        </div>
    );
};

export default Admin;
